import React from "react";

import "./styles/Badges.css";
import Navbar from "../components/Navbar.js";

export default class Badges extends React.Component {
	render() {
		return (
			<div>
				<Navbar />
        <div className="Badges">
          <div className="Badges_hero">
            .
          </div>
        </div>
			</div>
		);
	}
}
